import './Comments.scss';

function Comments() {
  return (
    <section className="conversation-container-posted">
      <article className="comment-container">
        <figure className="comment-container__picture">
          <img className="comment-container__picture-img" src="http://placeimg.com/48/48/any" alt="profile picture" />
        </figure>
        <div className="comment-body">
          <h3 className="comment-body__name">Will be Name</h3>
          <div className="comment-body__date"> Soon to be Date</div>
          <article className="comment-body__comment">
            <p></p>
          </article>
        </div>
      </article>
      <hr className="comment-container__divider" />
    </section>
  );
}

export default Comments;
